  const [color,setColor] = useState('white');
  useState(14)

  return (
    <div style={{padding: '10px', backgroundColor: color}}>
  <button onClick = { () => {setColor('black')} }> Dark </button>
  <button onClick = { () => {setColor('white')} }> Light </button>
</div>
  );
};


ReactDOM.render(
  <React.StrictMode>
    <App />
